import React, { Fragment } from "react";
// nodejs library that concatenates classes
import classNames from "classnames";
// @material-ui/core components
import { makeStyles } from "@material-ui/core/styles";
// @material-ui/icons
import MenuBookIcon from "@material-ui/icons/MenuBook";
import Favorite from "@material-ui/icons/Favorite";
// core components
import GridContainer from "../../components/Grid/GridContainer.js";
import GridItem from "../../components/Grid/GridItem.js";
import NavPills from "../../components/NavPills/NavPills.js";
import List from "@material-ui/core/List";
import ListItem from "@material-ui/core/ListItem";
import ListItemText from "@material-ui/core/ListItemText";
import Divider from "@material-ui/core/Divider";

import studio1 from "../../assets/img/profiles/727928.png";
import studio2 from "../../assets/img/profiles/772543.png";
import studio4 from "../../assets/img/profiles/831643.jpg";
import studio5 from "../../assets/img/profiles/847278.png";

import styles from "../../assets/jss/material-kit-react/views/profilePage.js";

const useStyles = makeStyles(styles);

export default function Favourites() {
   const classes = useStyles();

   const navImageClasses = classNames(classes.imgRounded, classes.imgGallery);
   return (
      <Fragment>
         <NavPills
            alignCenter
            color="info"
            tabs={[
               {
                  tabButton: "Favorites",
                  tabIcon: Favorite,
                  tabContent: (
                     <GridContainer justify="center">
                        <GridItem xs={12} sm={12} md={4}>
                           <img
                              alt="..."
                              src={studio1}
                              className={navImageClasses}
                           />
                           <img
                              alt="..."
                              src={studio2}
                              className={navImageClasses}
                           />
                        </GridItem>
                        <GridItem xs={12} sm={12} md={4}>
                           <img
                              alt="..."
                              src={studio5}
                              className={navImageClasses}
                           />
                           <img
                              alt="..."
                              src={studio4}
                              className={navImageClasses}
                           />
                        </GridItem>
                     </GridContainer>
                  ),
               },
               {
                  tabButton: "Lines",
                  tabIcon: MenuBookIcon,
                  tabContent: (
                     <List className={classes.root}>
                        <ListItem>
                           <ListItemText primary="Omae wa kono Dio ni totte no monkīna nda yo JoJooooo—————!!" />
                        </ListItem>
                        <Divider variant="inset" component="li" />
                        <ListItem>
                           <ListItemText primary="Sutando no pawā o zenkai da!" />
                        </ListItem>
                        <Divider variant="inset" component="li" />
                        <ListItem>
                           <ListItemText primary="Nigeru nda yoooo—————!" />
                        </ListItem>
                     </List>
                  ),
               },
            ]}
         />
      </Fragment>
   );
}
